export class Cv {
    id?: any;
    // photoCv?: any;
    nom?: string;
    prenom?: string;
    email?: string;
    telephone?: string;
    titCV?: string;
    profilCv?: Text;
    objecCarri?: Text;

    constructor(
        nom: string = '',
        prenom: string = '',
        hp: number = 100,
        cp: number = 10,
        picture: string = 'https://assets.pokemon.com/assets/cms2/img/pokedex/detail/xxx.png',
        types: string[] = ['Normal'],
        created: Date = new Date()
    ) {
        this.name = name;
        this.hp = hp;
        this.cp = cp;
        this.picture = picture;
        this.types = types;
        this.created = created;
    }
}
